	}

	render(props) {
		return (
		 <div className='player'>
          <Player  className='preview'>
      	   <source src="https://res.cloudinary.com/allansendagi-com/video/upload/v1565809320/videos/Pexels3_vzolxz.mp4" />
          </Player>
         </div>	
	   )
	}
}

